CREATE TABLE ACTEUR
(
  NUMFILM      INTEGER                          NOT NULL,
  NUMINDIVIDU  INTEGER                          NOT NULL
)
TABLESPACE USERS
PCTUSED    0
PCTFREE    10
INITRANS   1
MAXTRANS   255
STORAGE    (
            INITIAL          272K
            MINEXTENTS       1
            MAXEXTENTS       2147483645
            PCTINCREASE      0
            BUFFER_POOL      DEFAULT
           )
LOGGING 
NOCACHE
NOPARALLEL
NOMONITORING;


ALTER TABLE ACTEUR ADD (
  PRIMARY KEY
 (NUMFILM, NUMINDIVIDU)
    USING INDEX 
    TABLESPACE USERS
    PCTFREE    10
    INITRANS   2
    MAXTRANS   255
    STORAGE    (
                INITIAL          432K
                MINEXTENTS       1
                MAXEXTENTS       2147483645
                PCTINCREASE      0
               ));


ALTER TABLE ACTEUR ADD (
  FOREIGN KEY (NUMFILM) 
 REFERENCES FILM (NUMFILM));

ALTER TABLE ACTEUR ADD (
  FOREIGN KEY (NUMINDIVIDU) 
 REFERENCES INDIVIDU (NUMINDIVIDU));


GRANT SELECT ON  ACTEUR TO ETU4_ROLE;

GRANT SELECT ON  ACTEUR TO PUBLIC WITH GRANT OPTION;
GRANT REFERENCES ON  ACTEUR TO PUBLIC;
SET DEFINE OFF;
COMMIT;

